import React from 'react';
import LogoImg from '../img/logo.svg'
import NikeImg from '../img/nike.png'

const Card = () => {
  const colors = [
    {value: '#b6a179'},
    {value: '#272425'},
    {value: '#6389cb'},
    {value: '#f2c758'},
    {value: '#ffffff'},
  ];

  return <div>

   {/* Card */}
   <div className='w-[426px] min-h-[600px] bg-[#ffffffdd]'>


   {/* Card logo */}
   <div>logo</div>

      {/* Card title */}
      <div>title</div>
      {/* suntitle */}
      <div>suntitle</div>

      {/* btn & price wrapper */}
      <div>
        <button>button</button>
        <div>price</div>
          {/* colors */}
          <ul>
            {colors.map((color, index) => {
              return ( 
              <li key={index} style={{backgroundcolor: color.value}}
              className='w-8 h-8 rounded-full'>

              </li>
              );
            })}
          </ul>
      </div>

      </div>

  </div>;
};

export default Card;
